// SPDX-License-Identifier: MIT

pragma solidity ^0.8.0;


import "./NFT.sol";
import "./Events/Events.sol";
import "./Storage.sol";
import "./Modifiers/Modifiers.sol";


contract NFTData is Storage,NFT_Events,NFT_modifiers {


    constructor () {}

    // Metadata

    function Metadata(

        NFT _nft,
        address _owner,
        uint256 _tokenId,
        string memory _NFTtype,
        string memory _name,
        string memory _uri,
        string memory _description,
        uint256 _price


        ) public {


            nft memory newnft = nft ({

                _NFT:_nft,
                owner: _owner,
                tokenId:_tokenId,
                NFTtype:_NFTtype,
                name:_name,
                uri:_uri,
                description:_description,
                price : _price,
                timestamp: block.timestamp,
                status:"open"


            });


           Allnfts.push(newnft);


        }


    //  get all NFTs   



    function getAllNFTs() public view returns (nft[] memory _nfts) {

        return Allnfts;
    }


    //  getNFTby contract Address


    function getNFTbyAddress (address _NFTAddress) public view returns(nft memory _nft)  {

        uint index;

        for (uint i=0; i< NFT_addresses.length; i++) {

            if (NFT_addresses[i] == _NFTAddress) {

                index = i ;
            }

        }    

             return getNFtByIndex(index);
        }


    //  get Nft by Index  

    function getNFtByIndex(uint index) public view returns (nft memory _nft) {

        nft memory newnft = Allnfts[index];

        return newnft;
    }


    // update ownership


    function updateOwnership(NFT _NFT,address _owner) public returns (bool) {

        address New_NfT = address(_NFT);

        uint index;

        for (uint i=0; i< NFT_addresses.length; i++) {

            if (NFT_addresses[i] == New_NfT) {

                index = i ;
            }

        }    


      nft storage newnft = Allnfts[index];

      newnft.owner = _owner;

      return true;


    }

    // update status


    function updatestatus(address _NFT,string memory _status) public view returns (bool) {


      nft memory N = getNFTbyAddress(_NFT);

      N.status = _status;

      return true;


    }









}
